-- Table structure for webform_validation_rule
-- ----------------------------
DROP TABLE IF EXISTS `webform_validation_rule`;
CREATE TABLE `webform_validation_rule` (
  `ruleid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier for a rule',
  `rulename` varchar(255) NOT NULL DEFAULT '' COMMENT 'Name for the rule',
  `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The webform node.nid',
  `validator` varchar(255) NOT NULL DEFAULT '' COMMENT 'The validator key',
  `data` text COMMENT 'Additional rule data',
  `error_message` varchar(255) DEFAULT NULL COMMENT 'Rule error message',
  `negate` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'Validate the inverse of the rule',
  PRIMARY KEY (`ruleid`),
  KEY `nid` (`nid`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='Stores rule definitions';

-- ----------------------------
-- Records of webform_validation_rule
-- ----------------------------

-- ----------------------------
-- Table structure for webform_validation_rule_components
-- ----------------------------
DROP TABLE IF EXISTS `webform_validation_rule_components`;
CREATE TABLE `webform_validation_rule_components` (
  `ruleid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Unique identifier for a rule',
  `cid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The webform component id',
  PRIMARY KEY (`ruleid`,`cid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores components linked to a rule';

